import './style.scss'
const calendar = ()=>{
    const Days = ['Lundi','Mardi','Mercredi','Jeudi','Vendredi','Samedi','Dimanche'];
    const Hours = ['08:00-10:00','08:00-10:00','08:00-10:00','08:00-10:00','08:00-10:00','08:00-10:00','08:00-10:00']
    return(
        <table id="customers">
            <tr>
                <th>Hours/Day</th>
                {Days.map(day =>(<th>{day}</th>))}
            </tr>
            {Hours.map(hour => (
                <tr>
                    <th>{hour}</th>
                    {Days.map(day =>(<td>---</td>))}
                </tr>
            ))}
        </table>
    )
}
export default calendar ;
